```json
{
  "application": "VASP",
  "details": {
    "software": {
      "intel": "2019.1.144",
      "openmpi": "4.0.1",
      "vasp": "5.4.4"
    },
    "resources": {
      "nodes": 1,
      "tasks": 16,
      "cpus_per_task": 1,
      "memory_per_cpu": "1000mb",
      "time": "6:00:00"
    },
    "environment": {
      "slurm_submit_dir": "Current directory where the script was submitted"
    }
  }
}
```

**Explanation:**

* **Application:** The script runs the VASP (Vienna Ab initio Simulation Package) code.
* **Details:**
    * **Software:**
        * The script loads the Intel compiler (version 2019.1.144) and the OpenMPI library (version 4.0.1) using module commands.
        * It uses VASP version 5.4.4 located at `/home/joshuapaul/vasp_10-23-19_5.4.4/bin/vasp_stand`.
    * **Resources:**
        * The script requests 1 node, 16 tasks, 1 CPU per task, 1000MB of memory per CPU, and a time limit of 6 hours. 
    * **Environment:**
        * It uses the `$SLURM_SUBMIT_DIR` environment variable to change to the directory where the script was submitted.
